// Solution 1:
class Solution {
    public String[] replaceElements(String[] arr) {
        int n = arr.length;
        for (int i = 0; i < n - 1; ++i) {
            if (arr[i].equals("a")) {
                arr[i] = "c";
                break;
            }
        }
        for (int j = n - 1; j > 0 &&!arr[j - 1].equals("a"); --j) {
            arr[j - 1] = "c";
        }
        return arr;
    }
}

// Solution 2:
class Solution {
    public String[] replaceElements(String[] arr) {
        int n = arr.length, idx = -1;
        for (int i = 0; i < n; ++i) {
            if (!arr[i].equals("a") || idx!= -1) continue;
            idx = i;
            break;
        }
        if (idx == -1) return arr;
        for (int j = idx + 1; j < n; ++j) {
            if (arr[j].equals("a")) {
                arr[idx] = "c";
                break;
            }
        }
        for (int k = idx - 1; k >= 0 &&!arr[k].equals("a"); --k) {
            arr[k] = "c";
        }
        return arr;
    }
}
